import React, { useState, useEffect } from 'react';

const GuestPage = () => {
    const [screeningsByMovie, setScreeningsByMovie] = useState({});

    useEffect(() => {
        const fetchScreenings = async () => {
            const response = await fetch('https://localhost:8080/screenings/allScreeningTimesByMovies');
            const data = await response.json();
            setScreeningsByMovie(data);
        };

        fetchScreenings();
    }, []);

    return (
        <div className="guest-page">
            <h1>Screenings</h1>
            {Object.entries(screeningsByMovie).map(([movieTitle, screenings]) => (
                <div key={movieTitle}>
                    <h2>{movieTitle}</h2>
                    <ul>
                        {screenings.map((screeningInfo) => (
                            <li key={screeningInfo.screening.id}>
                                <p>Showtime: {screeningInfo.screening.showTime}</p>
                                <p>Room: {screeningInfo.room.name}</p>
                                {/* Access other movie, screening, and room fields here */}
                                <p>Movie details: (access details using movieInfo.movie object)</p>
                                {/* Example:  */}
                                <p> - Title: {movieInfo.movie.title}</p>
                                <p> - Description: {movieInfo.movie.description}</p>
                                <p> - ... (other movie fields)...</p>
                            </li>
                        ))}
                    </ul>
                </div>
            ))}
        </div>
    );
};

export default GuestPage;
